import React, { useState } from 'react';

const cakesData = [
    { id: 1, name: 'Торт шоколадный', recipe: 'Нежный шоколадный торт', image: 'data:image/jpeg;base64,',price:200},
      { id: 2, name: 'Торт фруктовый',recipe: 'Нежный фруктовый торт', image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQaB57lo_qr5e3guAhspGGr_ZWHEV4goZnALg&usqp=CAU' ,price:200},
      { id: 2, name: 'Тирамису', recipe: 'Нежный Тирамисса торт', image: 'data:image/jpeg;base64,' ,price:200},
      { id: 2, name: 'Сникерс', recipe: 'Нежный сникерс торт', image: 'data:image/jpeg;base64,',price:2000 },
      { id: 2, name: 'Медовик',recipe: 'Нежный медовый  торт', image: 'data:image/jpeg;base64,',price:200 },
      { id: 2, name: 'Нежный', recipe: 'Нежный торт', image: 'data:image/jpeg;base64,',price:200 },
      { id: 2, name: 'Клубничный', recipe: 'Нежный клубничный торт', image: 'data:image/jpeg;base64,',price:200 },
      { id: 2, name: 'Черничный', recipe: 'Нежный Черничный торт', image: 'data:image/jpeg;base64,' ,price:200},
    ];
    
    const Cake = ({ cake }) => {
      return (
        <div className="cake">
          <img src={cake.image} alt={cake.name} />
          <h2>{cake.name}</h2>
          <p>{cake.recipe}</p>
          <span>{cake.price}</span>
        </div>
      );
    };
    
    const CakeList = ({ cakes }) => {
      return (
        <div className="cake-list">
          {cakes.map((cake) => (
            <Cake key={cake.id} cake={cake} />
          ))}
        </div>
      );
    };
    
    const SearchCakes = () => {
      const [searchItem, setSearchItem] = useState('');
      const [searchResults, setSearchResults] = useState([]);
    
      const handleSearch = (event) => {
        const term = event.target.value;
        setSearchItem(term);
        const results = cakesData.filter((cake) =>
          cake.name.toLowerCase().includes(term.toLowerCase())
        );
        setSearchResults(results);
      };
    
      return (
        <div className="search-cakes">
          <input
            type="text"
            placeholder="Поиск тортов..."
            value={searchItem}
            onChange={handleSearch}
          />
          <CakeList cakes={searchItem ? searchResults : cakesData} />
          {searchItem && searchResults.length === 0 && <p>Не найдено!...🤷‍♂️</p>}
        </div>
      );
    };

    
    
    export default SearchCakes;
    